import React from 'react'
import {Row, Col, Input, Form} from 'antd';


{/*
Template
        <TextFieldComp
            label = ":"
            placeholder = "Enter "
            name = ""
        />
*/}

export class TextFieldComp extends React.Component {
    render() {
        const {myProp} = this.props;
        return (
            <Col span = {4}>
                <Row>
                    <label style ={{margin: '7px'}}>{this.props.label}</label>
                </Row>

                <Input style ={{margin: '7px'}} placeholder = {this.props.placeholder}/>


            </Col>
        )
    }
}

export default TextFieldComp
